INSERT INTO `autobroadcast` VALUES (1000001);
INSERT INTO `broadcast_text` VALUES (6000997, 'The Buff Machine gives you every available Buff for your specification including all available Worldbuffs for 2 hours. Of course, this is not possible on a real server, as you would most likely need an eternity for farming them and the first Buffs have already expired before you even finish collecting them...', 'The Buff Machine gives you every available Buff for your specification including all available Worldbuffs for 2 hours. Of course, this is not possible on a real server, as you would most likely need an eternity for farming them and the first Buffs have already expired before you even finish collecting them...', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (6000996, 'At the Competition Dummies there is a ranking NPC where you can see all DPS rankings. If you click on the name you can even see in the chat which item, talents and buffs the one had.', 'At the Competition Dummies there is a ranking NPC where you can see all DPS rankings. If you click on the name you can even see in the chat which item, talents and buffs the one had.', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (6000995, 'There is Arena PvP!\r\n\r\nSolo Queue:\r\n1v1, 2v2, 3v3, 5v5\r\n\r\nGroup Queue:\r\nIf you are in a group, the number of players in the group will automatically be added to the queue as a team size. So if you are 3 players in the group, you will be logged into the queue as a 3v3 team.', 'There is Arena PvP!', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (6000994, 'Your class NPC can set you to level 60 and has all kinds of BiS Gear templates with talents for almost all patches from WoW Classic. You can also get other items and Pets for your class there like poisons or totems. He can also reset talents or remove buffs.', 'Your class NPC can set you to level 60 and has all kinds of BiS Gear templates with talents for almost all patches from WoW Classic. You can also get other items and Pets for your class there like poisons or totems. He can also reset talents or remove buffs.', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (6000993, 'In your Stash Chest you can, among other things, deposit items or store your dressed armor, as well as save and learn talents and buffs.', 'In your Stash Chest you can, among other things, deposit items or store your dressed armor, as well as save and learn talents and buffs.', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (6000992, 'The machine next to Finkle can enchant any of your items with any enchantment in the game.', 'The machine next to Finkle can enchant any of your items with any enchantment in the game.', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (6000991, 'Finkle has every item that exists in the game and you can get it for free! it works like in the auction house that you already know because it makes the search and preview very easy.', 'Finkle has every item that exists in the game and you can get it for free! it works like in the auction house that you already know because it makes the search and preview very easy.', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (6000003, 'Choose a time mode.', 'Choose a time mode.', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (6000002, 'Ready for training? Then try to do your best, $n. There are different types of Fights you can choose. A normal Raid boss has 16 debuff slots. This Dummy can handle more debuffs even you can\'t see them because the Client can only show 16.', 'Ready for training? Then try to do your best, $n. There are different types of Fights you can choose. A normal Raid boss has 16 debuff slots. This Dummy can handle more debuffs even you can\'t see them because the Client can only show 16.', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (1000000, 'https://discord.gg/d5y9JwD', 'https://discord.gg/d5y9JwD', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (600245, 'I am Vaelan. What is your bidding?', 'I am Vaelan. What is your bidding?', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (600099, 'Welcome to UterusOne $n! What do yo need directions to? Choose and I\'ll show you where to go on the Minimap.', 'Welcome to UterusOne $n! What do yo need directions to? Choose and I\'ll show you where to go on the Minimap.', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (600069, 'Select a Player you want to watch in the Stormwind Arena.', NULL, 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (600068, 'The Arena Organizer Crystal.', 'The Arena Organizer Crystal.', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (600044, 'Welcome back, $n! To play Arena go to "uterusone.net" and download a small Patch file. Put it in your World of Warcraft/Data folder and log back on. If you did everything right, you can see a hovering crystal near me where you can queue up for all Arenas!', 'Welcome back, $n! To play Arena go to "uterusone.net" and download a small Patch file. Put it in your World of Warcraft/Data folder and log back on. If you did everything right, you can see a hovering crystal near me where you can queue up for all Arenas!', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (600021, 'This will override your current Specification. Are you sure?', 'This will override your current Specification. Are you sure?', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (600020, 'This is your Private Stash $n. Deposit your Items here or store up to 6 Equipement sets and Talent specifications. ', 'This is your Private Stash $n. Deposit your Items here or store up to 6 Equipement sets and Talent specifications. ', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (600018, 'Hi $n! I\'m able to craft almost every Item exists in this World! I just need an Item entry from you.', 'Hi $n! I\'m able to craft almost every Item exists in this World! I just need an Item entry from you.', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (600016, 'Finkle found a way to manipulate the random properties of some items. If you wear of them you will be able to chose other stats here. ', 'Finkle found a way to manipulate the random properties of some items. If you wear of them you will be able to chose other stats here. ', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (600015, 'CAUTION! If you change your Level, all your equipped Items gets destroyed and Talents reseted!', 'CAUTION! If you change your Level, all your equipped Items gets destroyed and Talents reseted!', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (600006, 'This will replace all of your current weared Items. Are you sure?', 'This will replace all of your current weared Items. Are you sure?', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (600005, 'Enchanting allows you to enchant items with a wide variety of beneficial effects. Tell me wich Item do you want to enchant, $n?', 'Enchanting allows you to enchant items with a wide variety of beneficial effects. Tell me wich Item do you want to enchant, $n?', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (600004, 'Hey $n. Here you will find the Best Damage Dealer on this Server. Wanna be better? Ha! Try it!', 'Hey $n. Here you will find the Best Damage Dealer on this Server. Wanna be better? Ha! Try it!', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (600002, 'I need to buy a Mount.', 'I need to buy a Mount.', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (600001, 'Hello! Need a Mount?', 'Hello! Need a Mount?', 0, 0, 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `broadcast_text` VALUES (600000, 'Teach me how to ride a Mount.', 'Teach me how to ride a Mount.', 0, 0, 0, 0, 0, 0, 0, 0, 0);
REPLACE INTO `broadcast_text` VALUES (600003, 'These are all pets that are available for your level, $n.', 'These are all pets that are available for your level, $n.', 0, 0, 0, 0, 0, 0, 0, 0, 0);
REPLACE INTO `broadcast_text` VALUES (600008, 'Make your choice, $C.', 'Make your choice, $C.', 0, 0, 0, 0, 0, 0, 0, 0, 0);
